import "./ExpensiveItem.css";

function ExpensiveItem() {
  return (
    <div className="expense-item ">
      <div className="expense-item__description">zamalk </div>
      <div>
        <h2> BAssal</h2>
        <div className="expense-item__price">this is my month</div>
      </div>
    </div>
  );
}
export default ExpensiveItem;
